"use strict";
const s =
  "";
const t =
  "";

function anagram(s, t) {
  if (s.length !== t.length) return false;
  const arrs = s
    .split("")
    .sort((a, b) => a.localeCompare(b))
    .join("");
  const arrt = t
    .split("")
    .sort((a, b) => a.localeCompare(b))
    .join("");

  return arrt === arrs;
}
console.log(anagram(s, t));
